import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import 'bootstrap/dist/css/bootstrap.css';
class Square extends React.Component {
    render() {
        return (
            <div className="square btn" onClick={this.props.onClick}>{this.props.value}</div>
        );
    }
}

class Board extends React.Component {
    check = () => {
        alert('click');
    }
    render() {
        return (
            <div>
                <div className="row">
                    <Square value={1} onClick={this.check} />
                    <Square value={2} onClick={this.check} />
                    <Square value={3} onClick={this.check} />
                </div>
                <div className="row">
                    <Square value={4} onClick={this.check} />
                    <Square value={5} onClick={this.check} />
                    <Square value={6} onClick={this.check} />
                </div>
                <div className="row">
                    <Square value={1} onClick={this.check} />
                    <Square value={1} onClick={this.check} />
                    <Square value={1} onClick={this.check} />
                </div>
            </div>
        );
    }
}

ReactDOM.render(<Board />, document.getElementById('root'));
